prod_01JN73AMFN2WBTSR6BRRNCST1H	ICTNEO Fountain pen	ict-neo-fountain-pen	The ICTNEO fountain pen is a tribute to Narcs Monturiol and his submarine Ictneo II, an icon of 19th-century naval engineering. With an elegant and ergonomic design, this pen combines history, functionality and accessibility. Available with copper or titanium finishes, it is ideal for those looking for an exclusive and comfortable writing instrument.	The ICTNEO fountain pen is inspired by the Ictneo II submarine, designed by Narcs Monturiol in 1864. This unique writing instrument reflects the pioneering spirit of the Industrial Revolution, transforming the legacy of innovation into a modern and functional design.\nMade with a matte black metal body, it features a stainless steel cap in copper or titanium finishes, chrome details and an ergonomic silicone grip for comfortable writing. Its medium stroke (M) stainless steel nib guarantees precision and fluidity.\nCompatible with international standard cartridges and piston converters (optional), the ICTNEO fountain pen adapts to the needs of each user. In addition, it is presented in a decorated case, ideal for giving as a gift or keeping as a collector's item.\nThe ICTNEO is not just a pen: it is a tribute to the history of exploration and a symbol of creativity, within the reach of anyone who wants to write their own story.	f	published	https://inoxcrom.es/784-thickbox_default/ictineo-fountain-pen.jpg	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	t	\N	2025-03-01 01:17:52.107983+05	2025-03-01 01:17:52.107983+05	\N	{"reference_id": "10251060"}
